package com.jsp.footmap.model;import java.util.Date;/** * 返回给客户端的数据类型 */public class ResponseMap {    private Date currentTime;    private String currentPlace;    public Date getCurrentTime() {        return currentTime;    }    public void setCurrentTime(Date currentTime) {        this.currentTime = currentTime;    }    public String getCurrentPlace() {        return currentPlace;    }    public void setCurrentPlace(String currentPlace) {        this.currentPlace = currentPlace;    }}